import React from 'react';


function Field(props) {           
    switch (props.fieldName){
        case 'scriptName':
        return <div class="field">
        <label htmlFor="scriptName">Script name * </label>
        <input type="text" id="scriptName" name="scriptName" onChange={props.onChange}></input>{addWhitespace()}
        </div>
        case 'errorCodes':
        return <div class="field">
        <label htmlFor="errorCodes">Error codes * </label>
        <input type="text" name="errorCodes" onChange={props.onChange}></input>{addWhitespace()}
        </div>
        case 'numAcc':
        return <div class="field">
        <label id="numAccLabel" htmlFor="numAcc">Number of accounts per error code * </label>
        <input id="numAccInput"type="number" name="numAcc" onChange={props.onChange}></input>{addWhitespace()}
        </div>   
    }

    function addWhitespace() {
        return <div>
            <br></br>
        </div>;
    }
}
export default Field;
